import React, { useState, useEffect } from 'react';
import * as data from '../Backend/d'

const AlkuEräLopetus = ({ eraName }) => {
  const [times, setTimes] = useState([]);

  useEffect(() => {
    fetchTimes();
  }, []);

  const fetchTimes = async () => {
    try {
      const response = await fetch('http://localhost:3001/api/aikataulu');
      if (!response.ok) {
        throw new Error('Failed to fetch times');
      }

      const data = await response.json();
      setTimes(data);
    } catch (error) {
      console.error('Error fetching times:', error);
    }
  };

  

  const calculateCombinedTimesByRound = () => {
    const combinedTimesByRound = {};

    times.forEach((time) => {
      const teamId = time.joukkue_id;
      const round = time.era;

      if (!combinedTimesByRound[round]) {
        combinedTimesByRound[round] = {};
      }

      if (!combinedTimesByRound[round][teamId]) {
        combinedTimesByRound[round][teamId] = 0;
      }

      combinedTimesByRound[round][teamId] += time.aika;
    });

    return combinedTimesByRound;
  };

  const findWinnersAndNonWinnersByRound = () => {
    const combinedTimesByRound = calculateCombinedTimesByRound();
    const winnersByRound = {};
    const allWinners = [];
    let allNonWinners = [];
  
    Object.keys(combinedTimesByRound).forEach((round) => {
      const combinedTimesByTeam = combinedTimesByRound[round];
      const roundWinners = findRoundWinners(combinedTimesByTeam);

      allWinners.push(...roundWinners);
  
      winnersByRound[round] = roundWinners;
  
      const nonWinners = Object.keys(combinedTimesByTeam)
        .filter((teamId) => !roundWinners.some((winner) => winner.teamId === teamId))
        .map((teamId) => ({ teamId, combinedTime: combinedTimesByTeam[teamId], round }));
  
      allNonWinners.push(...nonWinners);
    });
  
    allNonWinners.sort((a, b) => a.combinedTime - b.combinedTime);
  
    return { winnersByRound, allNonWinners };
  };

  

  const findRoundWinners = (combinedTimesByTeam) => {
    const roundWinners = [];
    Object.keys(combinedTimesByTeam).forEach((teamId) => {
      const combinedTime = combinedTimesByTeam[teamId];

      const isWinner = Object.values(combinedTimesByTeam).every(
        (otherCombinedTime) => combinedTime <= otherCombinedTime
      );

      if (isWinner) {
        roundWinners.push({ teamId, combinedTime });
      }
    });

    return roundWinners;
  };

  const updateJoukkueWithUniqueValues = async (joukkueId, updatedFields) => {
    try {
      // Check if 'kerailyera' needs to be updated
      if ('kerailyera' in updatedFields) {
        // Generate a unique kerailyera value
        const uniqueKerailyEra = await data.generateUniqueKerailyEra();
        updatedFields.kerailyera = uniqueKerailyEra;
      }

      // Check if 'semifinalist' needs to be updated
      if ('semifinalist' in updatedFields) {
        // Generate a unique semifinalist value
        const uniqueSemifinalist = await data.generateUniqueSemifinalist();
        updatedFields.semifinalist = uniqueSemifinalist;
      }

      // Call the updateJoukkue function with the updatedFields
      await data.updateJoukkue(joukkueId, updatedFields);
    } catch (error) {
      console.error('Error updating joukkue:', error);
      // Handle error as needed
    }
  };

  const handleLopetaClick = async () => {
    try {
      // Fetch and process times
      const winnersByRound = findWinnersByRound();
  
      // Display or use winners by round as needed
      console.log('Winners by Round:', winnersByRound);
  
      // Update joukkueet with unique values for semifinalist
      const updateWinnersPromises = allWinners.map(async (winner) => {
        const { joukkueId, combinedTime } = winner;
  
        // Fetch unique semifinalist value from the backend
        const uniqueSemifinalist = await data.generateUniqueSemifinalist();
  
        // Use the fetched value to update semifinalist
        const updatedFields = {
          semifinalist: uniqueSemifinalist,
          // Add other fields as needed
        };
  
        await updateJoukkueWithUniqueValues(joukkueId, updatedFields);
  
        return { joukkueId, success: true };
      });
  
      // Update joukkueet with unique values for kerailyera
      const updateNonWinnersPromises = remainingNonWinners.map(async (nonWinner) => {
        const { teamId, combinedTime } = nonWinner;
  
        // Fetch unique kerailyera value from the backend
        const uniqueKerailyEra = await data.generateUniqueKerailyEra();
  
        // Use the fetched value to update kerailyera
        const updatedFields = {
          kerailyera: uniqueKerailyEra,
          // Add other fields as needed
        };
  
        await updateJoukkueWithUniqueValues(teamId, updatedFields);
  
        return { teamId, success: true };
      });
  
      // Wait for all updates to complete
      const updateWinnersResults = await Promise.all(updateWinnersPromises);
      const updateNonWinnersResults = await Promise.all(updateNonWinnersPromises);
  
      console.log('Winners updated successfully:', updateWinnersResults);
      console.log('Non-winners updated successfully:', updateNonWinnersResults);
    } catch (error) {
      console.error('Error handling lopeta click:', error);
      // Handle error as needed
    }
  };
  
  return (
    <div>
      <button onClick={handleLopetaClick}>Lopeta erä</button>
    </div>
  );
};

export default AlkuEräLopetus;
